import DFS from './dfs';
import BFS from './bfs';

var UIcontrol = (function(){

    var algoName = ["none", "Dijkstras", "BFS", "DFS", "A*", "Swarm"];
    var speedVal = [NaN, 100, 50, 20];
    var i,j;

    let x = 11;
    let y = 11;
    var mouseDown = false;
    document.getElementById("2121").classList.add("cur");
    document.getElementById("2121").addEventListener("mousedown",function(){
        if(mouseDown === true)
            mouseDown = false;
        else mouseDown = true;
    });

    for (let i = 0; i < 20; i++) {
        for (let j = 0; j < 51; j++) {
            let a = i + 10;
            let b = j + 10;
            let cur = document.getElementById(a + "" + b);
            cur.addEventListener("mouseenter", function (a, b) {
                if(mouseDown === true)
                    cur.classList.add("cur");
            });
        }
    }


    return {
        input: function () {
            return {
                algorithm: algoName[document.getElementById("algo").value],
                speed: speedVal[document.getElementById("speed").value],
                src_i: i,
                src_j: j
            }
        },
        clear:function(){
            for(let i=0;i<20;i++){
                for(let j=0;j<51;j++){
                    let a = i+10;
                    let b = j+10;
                    document.getElementById(a + "" + b).className = "";
                }
            }
        }
    }
    
})();

export default UIcontrol;
